!function(a){try{a=angular.module("veasy.calendar")}catch(e){a=angular.module("veasy.calendar",[])}a.run(["$templateCache",function(e){e.put("veasy-calendar.html",'<div class=vcalendar><div class=vcalendar-header><button class="btn btn-default" ng-click=previousMonth()><i class="fa fa-angle-left vcalendar-arrow"></i></button> <span>{{calendar.title}}</span> <button class="btn btn-default" ng-click=nextMonth()><i class="fa fa-angle-right vcalendar-arrow"></i></button></div><div class=vcalendar-body><div class=vcalendar-header-row><div class=vcalendar-header-col ng-repeat="day in calendar.weekDays"><span>{{day}}</span></div></div><div class=vcalendar-body-row ng-repeat="week in calendar.weeks"><div class=vcalendar-body-col ng-class="{ \'vcalendar-today\': day.isToday, \'vcalendar-weekend-day\': day.isWeekend, \'vcalendar-is-not-current-month-day\': !day.isCurrentMonth }" ng-repeat="day in week" ng-click=onClickDay()><span class=vcalendar-day ng-class="{ }">{{day.day}}</span><div style="overflow: auto; flex-grow: 1;max-height: 100px;padding-top: 2px;"><div class=vcalendar-event ng-click="onClickEvent($event, event)" ng-style="{ \'background-color\': event.color }" ng-repeat="event in day.events"><span class=vcalendar-util-truncate>{{event[getEventTitle()]}}</span></div></div></div></div></div><div class=vcalendar-footer></div><div id=event-modal class="modal fade" tabindex=-1 role=dialog><div class=modal-dialog role=document><div class=modal-content><div class=modal-header><button type=button class=close data-dismiss=modal><span>&times;</span></button><h4 class=modal-title>{{config.eventModal.title}}</h4></div><div class=modal-body><form><div class=form-group ng-repeat="field in config.fields"><label for={{field.field}}>{{field.label}}</label> <input ng-if="field.type === \'text\'" id={{field.field}} type=text class=form-control ng-model=openedEvent[field.property]> <input ng-if="field.type === \'number\'" id={{field.field}} type=number class=form-control ng-model=openedEvent[field.property]> <input ng-if="field.type === \'moment\'" id={{field.field}} type=text class=form-control ng-model=openedEvent[field.property] v-moment-format={{field.format}}></div></form></div><div class=modal-footer><button type=button class="btn btn-default" data-dismiss=modal>Cancel</button> <button type=button class="btn btn-primary" ng-click=onSaveEvent(openedEvent)>Save</button></div></div></div></div></div>')}])}();